-- Table structure for table `earthquake`
DROP TABLE IF EXISTS `earthquake`;
CREATE TABLE `earthquake` (
  `earthquake_event_id` varchar(255) DEFAULT NULL COMMENT '地震事件id',
  `serial_number` bigint DEFAULT NULL COMMENT '序号',
  `earthquake_time` datetime DEFAULT NULL COMMENT '发震时间',
  `latitude` double DEFAULT NULL COMMENT '纬度/°',
  `longitude` double DEFAULT NULL COMMENT '经度/°',
  `depth` double DEFAULT NULL COMMENT '深度/千米',
  `magnitude` double DEFAULT NULL COMMENT '震级/M',
  `epicenter_location` text COMMENT '震源位置',
  `epicenter_location_region_code` double DEFAULT NULL COMMENT '震源位置地区代码',
  `country_code` bigint DEFAULT NULL COMMENT '国家代码',
  `country` text COMMENT '国家',
  `province_code` double DEFAULT NULL COMMENT '省份代码',
  `province` text COMMENT '省份',
  `city_code` double DEFAULT NULL COMMENT '城市代码',
  `city` text COMMENT '城市',
  `id` bigint NOT NULL COMMENT 'id'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='地震数据表';
