-- Table structure for table `floor_1989_2017`
DROP TABLE IF EXISTS `floor_1989_2017`;
CREATE TABLE `floor_1989_2017` (
  `id` BIGINT COMMENT '唯一标识 ID',
  `Start_date` DATE DEFAULT NULL COMMENT '灾害开始日期',
  `End_date` DATE DEFAULT NULL COMMENT '灾害结束日期',
  `Country` VARCHAR(255) DEFAULT NULL COMMENT '国家名称',
  `ISO` VARCHAR(255) DEFAULT NULL COMMENT '国家的 ISO 代码',
  `Location` VARCHAR(255) DEFAULT NULL COMMENT '具体位置描述',
  `latitude` DOUBLE DEFAULT NULL COMMENT '纬度',
  `longitude` DOUBLE DEFAULT NULL COMMENT '经度',
  `Magnitude` VARCHAR(255) DEFAULT NULL COMMENT '灾害影响范围（数值）',
  `Magnitud_1` VARCHAR(255) DEFAULT NULL COMMENT '灾害影响范围（单位）',
  `Disaster_t` VARCHAR(255) DEFAULT NULL COMMENT '灾害类型',
  `Disaster_s` VARCHAR(255) DEFAULT NULL COMMENT '灾害子类型',
  `Associated` VARCHAR(255) DEFAULT NULL COMMENT '关联灾害描述',
  `Insured_lo` VARCHAR(255) DEFAULT NULL COMMENT '保险损失（单位：美元）',
  `Total_dama` VARCHAR(255) DEFAULT NULL COMMENT '总损失（单位：美元）',
  `Associat_1` VARCHAR(255) DEFAULT NULL COMMENT '其他相关信息',
  `Total_deat` INT DEFAULT NULL COMMENT '总死亡人数',
  `Total_affe` INT DEFAULT NULL COMMENT '总受影响人数',
  `Disaster_1` VARCHAR(50) DEFAULT NULL COMMENT '灾害编号'
