-- Table structure for table `landslide`
DROP TABLE IF EXISTS `landslide`;
CREATE TABLE `landslide` (
  `id` BIGINT NOT NULL COMMENT '唯一标识 ID',
  `src_name` VARCHAR(255) DEFAULT NULL COMMENT '来源名称',
  `src_link` VARCHAR(255) DEFAULT NULL COMMENT '来源链接',
  `ev_id` BIGINT DEFAULT NULL COMMENT '事件 ID',
  `ev_date` DATE DEFAULT NULL COMMENT '事件日期',
  `ev_time` TIME DEFAULT NULL COMMENT '事件时间',
  `ev_title` VARCHAR(255) DEFAULT NULL COMMENT '事件标题',
  `ev_desc` TEXT DEFAULT NULL COMMENT '事件描述',
  `loc_desc` VARCHAR(255) DEFAULT NULL COMMENT '位置描述',
  `loc_accu` VARCHAR(255) DEFAULT NULL COMMENT '位置精度描述',
  `ls_cat` VARCHAR(255) DEFAULT NULL COMMENT '滑坡类型',
  `ls_trig` VARCHAR(255) DEFAULT NULL COMMENT '触发因素',
  `ls_size` VARCHAR(255) DEFAULT NULL COMMENT '滑坡规模',
  `ls_setting` VARCHAR(255) DEFAULT NULL COMMENT '滑坡发生环境',
  `fatalities` INT DEFAULT NULL COMMENT '死亡人数',
  `injuries` INT DEFAULT NULL COMMENT '受伤人数',
  `storm_name` VARCHAR(255) DEFAULT NULL COMMENT '风暴名称',
  `photo_link` VARCHAR(255) DEFAULT NULL COMMENT '照片链接',
  `comments` TEXT DEFAULT NULL COMMENT '评论',
  `ev_imp_src` VARCHAR(255) DEFAULT NULL COMMENT '事件影响来源',
  `ev_imp_id` VARCHAR(255) DEFAULT NULL COMMENT '事件影响 ID',
  `latitude` DOUBLE NOT NULL COMMENT '纬度',
  `longitude` DOUBLE NOT NULL COMMENT '经度',
  `ctry_name` VARCHAR(255) DEFAULT NULL COMMENT '国家名称',
  `ctry_code` CHAR(2) DEFAULT NULL COMMENT '国家代码',
  `div_name` VARCHAR(255) DEFAULT NULL COMMENT '地区名称',
  `gaz_point` VARCHAR(255) DEFAULT NULL COMMENT '地理坐标点',
  `gaz_dist` VARCHAR(255) DEFAULT NULL COMMENT '距离相关地理点的距离',
  `sub_date` DATE DEFAULT NULL COMMENT '提交日期',
  `edit_date` DATE DEFAULT NULL COMMENT '编辑日期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='滑坡事件数据表';
