  `type` bigint DEFAULT NULL COMMENT '数据类型',
  `id` bigint NOT NULL  COMMENT '记录的唯一标识符'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb3 COMMENT='火点遥感数据表';
